import { SoccerPlayer } from "./Components/SoccerPlayer";
import { Ball } from "./Components/ball";

import "./App.css";

import bg from "./halisaha.png";

function App() {
  return (
    <div className="App">
      <h1>Vay Bee</h1>
      <header className="App-header">
        <img src={bg} />
        <SoccerPlayer />
        <SoccerPlayer />
        <Ball />
      </header>
    </div>
  );
}

export default App;
